import React from "react";
import hotels from './hotels.js'

export default function hotelShort() {
    return(
        <div>
            {hotels.map((hotel, index) => {
                <>
                    <img>{hotel.image}</img>
                    <h3>{hotel.name}</h3>
                </>
            })}
        </div>
    )
}
